#include "fs/operations.h"
#include <assert.h>
#include <string.h>
#include <unistd.h>

int main() {

    char *str = "";

    char *path = "/f1";

    char buffer[20001];
    
    //Inicia o sistema de ficheiros
    assert(tfs_init() != -1);

    //Cria o ficheiro 
    int fhandle = tfs_open(path, TFS_O_CREAT);

    assert(fhandle != -1);

    //Escreve a variavel str para o ficheiro aberto
    ssize_t written = tfs_write(fhandle, str, strlen(str));

    size_t strlength = strlen(str);

    assert(written == strlength);

    //Como foi escrito str, o file handle esta na ultima posicao,
    //sendo assim necessario repor.

    open_file_entry_t *file = get_open_file_entry(fhandle);

    file->of_offset = 0;

    //Le o que foi escrito para uma variavel

    ssize_t read = tfs_read(fhandle, buffer, strlen(str));

    fputs(buffer, stdout);

    assert(read == strlen(str));

    buffer[20000] = '\0';

    for (int i = 0; i < 19999; i++) {
        if (buffer[i] != str[i]) {
            printf("\nCaractere original: %c", str[i]);
            printf("\nCaractere copiado:  %c", buffer[i]);
            printf("\nPosicao: %d", i);
        }
    }

    printf("\n\nValor do strcmp: %d", strcmp(buffer, str));

    assert(strcmp(buffer, str) == 0);

    return 0;
}

